import React, { useContext } from 'react';
import { AppContext } from '../context/Context1';
import WorkerItem from './WorkerItem';
import { Grid } from '@mui/material';

export default function Workers() {
    const { worker_ar, worker_Favorites_ar } = useContext(AppContext);

    return (
      <div>
        {worker_ar.map(worker => (
          <WorkerItem 
            key={worker.id} 
            item={worker} 
            isFavorite={worker_Favorites_ar.some(fav => fav.id === worker.id)} 
          />
        ))}
      </div>
    );
}
